import React from 'react';
//import logo from './logo.svg';
import './App.css';
import { BrowserRouter as Router, Route, Link} from "react-router-dom";
import HomePage from './routes/HomePage';

function App() {

  return(
    <Router>
    <div className="App">
      <h1>PORTFOLIO</h1>
    </div>
      <Route exact path='/HomePage' element={<HomePage/>}/>
    </Router>
  )

};
export default App;
